import React from 'react';
import { Row, Col, Button } from 'react-bootstrap';
import '../index.css'

const Catogery = ({filtercatogery , allcategores}) => {
    return (
        <Row>
            <Col className='d-flex justify-content-center flex-wrap mt-3'>
            {allcategores.length >=1?(allcategores.map((cat)=>{
                return(
                    <div>
                    <Button className='space mt-2' variant="outline-primary">Primary</Button>
                    <Button className='space mt-2' variant="outline-warning">Warning</Button>
                    <Button className='space mt-2' variant="outline-secondary">Secondary</Button>
                    <Button className='space mt-2' variant="outline-danger">Danger</Button>
                    </div>

                )
            })): null}
               
            </Col>

        </Row>
    )
}



export default Catogery;
